import { Button, Card, Col, Row } from "antd";

import "./InternshipsList.scss";

const categoryWidths = {
  internshipTitle: { lg: 8, xl: 8, xxl: 8 },
  completitionPeriod: { lg: 4, xl: 4, xxl: 4 },
  totalEnrolled: { lg: 3, xl: 3, xxl: 3 },
  qualifiedCandidates: { lg: 5, xl: 5, xxl: 5 },
  icons: { lg: 3, xl: 3, xxl: 3 },
};

const InternshipsList = () => {
  const renderCategoryRow = () => {
    return (
      <Row justify="center" align="center">
        <Col className="internshipListCard__categoryRow__column" {...categoryWidths.internshipTitle}>
          Internship Title
          <Button icon={<DownOutlined />} type="ghost" size="small" />
        </Col>
        <Col className="internshipListCard__categoryRow__column" {...categoryWidths.completitionPeriod}>
          Completition Period
          <Button icon={<DownOutlined />} type="ghost" size="small" />
        </Col>
        <Col className="internshipListCard__categoryRow__column" {...categoryWidths.totalEnrolled}>
          Total Enrolled
          <Button icon={<DownOutlined />} type="ghost" size="small" />
        </Col>
        <Col className="internshipListCard__categoryRow__column" {...categoryWidths.qualifiedCandidates}>
          Qualified Candidates
          <Button icon={<DownOutlined />} type="ghost" size="small" />
        </Col>
        <Col className="internshipListCard__categoryRow__column" {...categoryWidths.icons} />
      </Row>
    );
  };

  return (
    <Card bodyStyle={{ height: "100%", padding: "0px" }} className="internshipListCard">
      <Row style={{ height: "100%" }}>
        <Col span={24} className="internshipListCard__categoryRow">
          {renderCategoryRow()}
        </Col>
        <Col span={24} className="internshipListCard__list" />
      </Row>
    </Card>
  );
};

export default InternshipsList;
